import { useSelector } from "react-redux"
import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

export const DriveTypes = () => {

    let driveTypes = useSelector(x => x.DriveTypes)


    //    DriveTypes: [{ id: 1, description: "דלק", pricePerLiter: 10 },

    return <>
    <TableContainer component={Paper} >
      <Table id="dr" sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            {/* <TableCell>Dessert (100g serving)</TableCell> */}
            <TableCell align="right">סוג הנעה</TableCell>
            <TableCell align="right">מחיר</TableCell>
            {/* <TableCell align="right">Carbs&nbsp;(g)</TableCell>
            <TableCell align="right">Protein&nbsp;(g)</TableCell> */}
          </TableRow>
        </TableHead>
        <TableBody>
          {driveTypes.map((t) => (
            <TableRow
              key={t.description}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                {t.description}
              </TableCell>
              {/* <TableCell align="right">{t.description}</TableCell> */}
              <TableCell align="right">{t.pricePerLiter}</TableCell>
              {/* <TableCell align="right">{row.carbs}</TableCell>
              <TableCell align="right">{row.protein}</TableCell> */}
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>



{/* 
        <p>jhjbhjhjbhvj</p>
        {driveTypes.map(t => {
            return <>
                <p>{t.id}</p>
                <p>{t.description}</p>
                <p>{t.pricePerLiter}</p>
                <p>*****************</p>
            </>
        })} */}
    </>
}
